import React, { useState, useEffect } from 'react';

const Die = (props) => {
  const styles = {
    backgroundColor: props.clicked ? '#59E391' : '#ffffff',
  };

  return (
    <button onClick={props.handleClicked} className='dice' style={styles}>
      {props.randomNum}
    </button>
  );
};

export default Die;
